import { useSelector } from "react-redux";
import Card from "../Card/Card";

 const Favourites= ()=>{

    const myFavorites = useSelector((state)=>state.myFavorites);


    return(
        <div>
            {myFavorites?.map((fav)=>(
                <Card 
                id={fav.id} 
                name = {fav.name}
                key={fav.id}
                gender={fav.gender}
                image={fav.image} />
            ))}
        </div>
    )
}


export default Favourites;
